namespace MermaidSharp.Diagrams.Geo;

public sealed record GeoRegionDefinition(
    string Id,
    string PathData,
    Position LabelPosition,
    string? Label = null,
    string? Fill = null,
    string? Stroke = null,
    IReadOnlyCollection<string>? Aliases = null);

public sealed record GeoMapDefinition(
    string Name,
    double Width,
    double Height,
    double MinLongitude,
    double MaxLongitude,
    double MinLatitude,
    double MaxLatitude,
    IReadOnlyList<GeoRegionDefinition> Regions,
    IReadOnlyCollection<string>? Aliases = null,
    string? Attribution = null,
    GeoProjection? RequiredProjection = null);

public interface IGeoMapPackPlugin
{
    string Name { get; }
    IReadOnlyCollection<string> Aliases { get; }
    IReadOnlyCollection<GeoMapDefinition> Maps { get; }
}

public sealed class StaticGeoMapPackPlugin(
    string name,
    IReadOnlyCollection<GeoMapDefinition> maps,
    IReadOnlyCollection<string>? aliases = null) : IGeoMapPackPlugin
{
    public string Name { get; } = name;
    public IReadOnlyCollection<string> Aliases { get; } = aliases ?? [];
    public IReadOnlyCollection<GeoMapDefinition> Maps { get; } = maps;
}

public sealed class GeoMapRegistry
{
    readonly object _sync = new();
    readonly List<IGeoMapPackPlugin> _plugins = [];

    public IReadOnlyCollection<IGeoMapPackPlugin> Plugins
    {
        get
        {
            lock (_sync)
            {
                return [.. _plugins];
            }
        }
    }

    public bool TryRegister(IGeoMapPackPlugin plugin, out string? error)
    {
        try
        {
            Register(plugin);
            error = null;
            return true;
        }
        catch (Exception ex)
        {
            error = ex.Message;
            return false;
        }
    }

    public void Register(IGeoMapPackPlugin plugin)
    {
        ArgumentNullException.ThrowIfNull(plugin);
        if (string.IsNullOrWhiteSpace(plugin.Name))
            throw new ArgumentException("Geo map plugin name cannot be empty.", nameof(plugin));
        if (plugin.Maps.Count == 0)
            throw new ArgumentException("Geo map plugin must include at least one map.", nameof(plugin));

        foreach (var map in plugin.Maps)
        {
            if (string.IsNullOrWhiteSpace(map.Name))
                throw new ArgumentException("Geo map name cannot be empty.", nameof(plugin));
            if (map.Width <= 0 || map.Height <= 0)
                throw new ArgumentException($"Geo map '{map.Name}' must have positive width and height.", nameof(plugin));
            if (map.Regions.Count == 0)
                throw new ArgumentException($"Geo map '{map.Name}' must include at least one region path.", nameof(plugin));
        }

        var pluginIds = GetIdentifiers(plugin).ToHashSet(StringComparer.OrdinalIgnoreCase);
        lock (_sync)
        {
            _plugins.RemoveAll(existing => GetIdentifiers(existing).Any(pluginIds.Contains));
            _plugins.Insert(0, plugin);
        }
    }

    public bool Unregister(string pluginName)
    {
        if (string.IsNullOrWhiteSpace(pluginName))
            return false;

        lock (_sync)
        {
            return _plugins.RemoveAll(p => MatchesIdentifier(p, pluginName)) > 0;
        }
    }

    public IReadOnlyList<string> GetAvailableMapNames()
    {
        lock (_sync)
        {
            var seen = new HashSet<string>(StringComparer.OrdinalIgnoreCase);
            var names = new List<string>();
            foreach (var plugin in _plugins)
            {
                foreach (var map in plugin.Maps)
                {
                    if (seen.Add(map.Name))
                        names.Add(map.Name);
                }
            }

            return names;
        }
    }

    public GeoMapDefinition Resolve(string? mapName)
    {
        var requested = string.IsNullOrWhiteSpace(mapName) ? "world" : mapName.Trim();
        if (GeoCountryCatalog.TryResolveMapName(requested, out var normalized))
            requested = normalized;

        lock (_sync)
        {
            foreach (var plugin in _plugins)
            {
                foreach (var map in plugin.Maps)
                {
                    if (MatchesMapIdentifier(map, requested))
                        return map;
                }
            }

            var available = GetAvailableMapNames();
            var availableText = available.Count == 0 ? "none" : string.Join(", ", available);
            throw new MermaidException(
                $"Geo map '{requested}' is not registered. Available maps: {availableText}.");
        }
    }

    public bool TryResolve(string? mapName, out GeoMapDefinition map)
    {
        map = default!;
        try
        {
            map = Resolve(mapName);
            return true;
        }
        catch (MermaidException)
        {
            return false;
        }
    }

    static bool MatchesMapIdentifier(GeoMapDefinition map, string id)
    {
        if (string.Equals(map.Name, id, StringComparison.OrdinalIgnoreCase))
            return true;

        var aliases = map.Aliases;
        if (aliases is null)
            return false;

        return aliases.Any(alias => string.Equals(alias, id, StringComparison.OrdinalIgnoreCase));
    }

    static IEnumerable<string> GetIdentifiers(IGeoMapPackPlugin plugin)
    {
        yield return plugin.Name;
        foreach (var alias in plugin.Aliases)
        {
            if (!string.IsNullOrWhiteSpace(alias))
                yield return alias;
        }
    }

    static bool MatchesIdentifier(IGeoMapPackPlugin plugin, string id) =>
        string.Equals(plugin.Name, id, StringComparison.OrdinalIgnoreCase) ||
        plugin.Aliases.Any(alias => string.Equals(alias, id, StringComparison.OrdinalIgnoreCase));
}

